import { useState } from "react";

function Ct(type) {

    const [Type, setType] = useState();
    function gg() {
        switch (type) {
        case 1:setType(type)

            break;
        case 2:return    <i class="flaticon-heartbeat"></i>

            break;
            case 3:return    <i class="flaticon-medical-record"></i>   

            break;
            case 4:return    <i class="flaticon-flaticon-pharmacy"></i>

            break;
            case 5:return    <i class="flaticon-pills"></i>            

            break;
            case 6:return    <i class="flaticon-stethoscope"></i>      
            break;

        default:<i class="flaticon-stethoscope"></i>
            break;
    }
    }
  return(
    <>
    <i class={Type}></i>
    </>
  )
}
export default Ct
